@Override
public FlushPolicy clone() {
  FlushPolicy clone;
  try {
    clone = (FlushPolicy) super.clone();
  } catch (CloneNotSupportedException e) {
    // should not happen
    throw new RuntimeException(e);
  }
  clone.writer = new SetOnce<DocumentsWriter>();
  clone.indexWriterConfig = null;
  return clone;
}

